<#
.Synopsis
Add a contact to the root Contacts folder or to the contacts endpoint of another contact folder.
.Description
Add a contact to the root Contacts folder or to the contacts endpoint of another contact folder.
.Example
Import-Module Microsoft.Graph.PersonalContacts

$params = @{
	givenName = "Pavel"
	surname = "Bansky"
	emailAddresses = @(
		@{
			address = "pavelb@fabrikam.onmicrosoft.com"
			name = "Pavel Bansky"
		}
	)
	businessPhones = @(
		"+1 732 555 0102"
	)
}

